import React from "react";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";

function Login() {
  return (
    <Container>
      <Grid container>
        <Grid item xs={6}>
          <Paper>Login</Paper>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Login;
